	  ctrl.$isEmpty = function(value) {
	    return value !== trueValue;
	  };

	  ctrl.$formatters.push(function(value) {
	    return value === trueValue;
	  });

	  ctrl.$parsers.push(function(value) {
	    return value ? trueValue : falseValue;
	  });
